87a0f292-8fe7-4783-a05e-5dd58bfbcea0	Sigurrs	Sigurrs\r\n\r\nA child of the river, born from the murk of the Great Iris Canal, Sigurrs was shaped by paradox. Raised in Aerans rigid martial hierarchy yet never truly belonging to it, he was Grandmaster Illamars secret masterpiecea weapon forged in the dark, far from the sacred dueling codes of his peers. Though denied inheritance and title, he became the blade Illamars blood son, Sirrhadiyr, could never wield: a Deathly One, Aerans most feared class of assassin. His training stripped him of mercy, replacing it with a cold calculus of angles, pressures, and vulnerabilities. He killed without flourish, leaving corpses so clinically dispatched they seemed untouched by violencea signature that earned him the moniker Bloodless Ghost.\r\n\r\nThe cost of his artistry is Anathemaa gnawing void where purpose once resided. His skills, once a source of grim pride, now feel like borrowed tools with no hand to wield them. He wanders Feria, a specter adrift, carrying only the echoes of Aerans teachings: A Deathly One does not dream. They dissolve. Yet dissolution eludes him. Each killclean, efficient, devoid of passiondeepens the hollowness. His calming touch, which once gave him fleeting connection to others emotions, now feels like a curse, forcing him to absorb the fear, regret, or resignation of those he ends.\r\n\r\nContrast with Nikolas: \r\nWhere Nikolas burns with ambition, Sigurrs smolders with existential ash. Nikolas fights with raw, adaptive instinct, thriving in chaos; Sigurrs dances through combat like a mathematician executing a pre-solved equation, every motion rehearsed ten thousand times. He is faster, leanera scalpel to Nikolass hammeryet envies the latters uncomplicated hunger. Their encounters crackle with unspoken rivalry: Sigurrs, the artist without a canvas; Nikolas, the brute with a kingdom to claim.\r\n\r\nKaos relation?	Main	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-15 18:22:42.274	2026-02-26 21:40:47.71	\N	5da036a0-d566-4d97-84fb-0dd04cf5aa33	\N	Male	\N	http://localhost:3000/uploads/characters/9a8e0a33-e9e5-432f-81ad-dda0a44c20d2.jpg	{http://localhost:3000/uploads/characters/44bebebb-e657-445c-90a3-35ae07ed0c55.png,http://localhost:3000/uploads/characters/f54fd4d5-629a-4431-8989-0b6d91254764.jpg,http://localhost:3000/uploads/characters/c7e05aaa-6bc6-4966-b16b-bad31cb6505a.jpg,http://localhost:3000/uploads/characters/f0c870a9-7de7-4bf4-b023-f09320b3ae4e.jpg,http://localhost:3000/uploads/characters/f825fe7e-d32a-4b44-9bfa-f76aded5ac8e.jpg}	\N	f	\N
