5df6f2b6-890b-4588-b743-d886370f1396	Caedric, the Mosaic	Caedric is a mosaic prince. it means he is the child of two pure higher mosaics. The King of the Mosaics, Sverevin and his wife, Linfrei of the Southrun Kingdoms.\r\n\r\nCaedric wants to bring back the glory of the Mosaics  , so friscel is really talented, she was a thief and grew up in Varamor. She knows a lot about humans and varamor which cedric plans to overtake as part of conquering one of the five major kingdoms in vera\r\n\r\nCedric is a skilled warrior and tactician, having received extensive training in combat and strategy from a young age.\r\nHe is fiercely proud of his mosaic heritage and sees it as his duty to restore the power and influence of the mosaic race.\r\nCedric's desire for power and control often leads him to make ruthless decisions and alliances, even if it means betraying those closest to him.\r\nHe is a charismatic and persuasive leader, able to inspire loyalty and devotion from his followers.\r\nCedric possesses a strong sense of honor and duty, but his ambitions sometimes cause him to compromise his own principles.\r\nHe has a particular animosity towards humans, whom he sees as inferior and unworthy of sharing the world with the powerful mosaic race.	Antagonist	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-15 18:22:42.274	2025-02-23 09:22:27.059	\N	e2f41ff4-c340-45bc-b269-d4827365eec6	\N	Male	\N	http://localhost:3000/uploads/characters/1dbe74c9-bd28-45cc-b88e-c89f9ed5eeba.png	{http://localhost:3000/uploads/characters/8a27707f-6177-4f79-b7c2-c383a78ff8f3.png}	\N	f	\N
