d50cdfd1-14a0-4576-875d-62da3a7d45d7	Marbles	The trickster. Merry name, disfigured face. Rumor is he'd tricked and pushed off some powerful merc down to the depths so he could steal his belongings off of his dead body of course. What he hadn't realised until much later was that the man had not only escaped the depths, but also became a baron. The great trickster Marbles had had his mouth shut, literally. The baron ordered his lips sewed shut so he could never talk his clever tongue again. Marbles however was much more resourceful when he couldn't use his strongest weapon. He somehow escaped the dungeons he was imprisoned in during the fall of the baron.\r\n\r\n\r\nHe meets leaf, with his hands tied and lips sewed. Leaf agrees to help marbles, unties his hand and rids him of his bindings. He could speak again, marvels ecstatic, thanks leaf and makes a mental note of never hurting or tricking this child in anyway.	Minor	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-15 18:22:42.275	2025-02-23 19:11:33.675	\N	7ff6b318-c6ec-455b-8a39-16999583c8a7	\N	Male	\N	http://localhost:3000/uploads/characters/a60d983a-c70d-4e25-97fc-fba293d9917c.png	{http://localhost:3000/uploads/characters/4fd877e6-a2eb-4a76-b860-87916f8a6038.png,http://localhost:3000/uploads/characters/2d319979-8986-4dd8-a0bb-cfd7e1c15009.png,http://localhost:3000/uploads/characters/7883e5a9-c581-4dbf-a288-f72cc7e95605.png}	\N	f	\N
