ea2e4979-afd9-400a-9ac9-172794e17d03	Irythn	Born into the royal family, Irythn was groomed for leadership and war. His upbringing honed his skills as a warrior and strategist. Initially, he fulfilled his role dutifully, leading armies and maintaining order. However, a pivotal encounter with Sigurros, a former comrade, challenged his perceptions of justice and authority. This rebellion revealed the injustices within the kingdom, prompting Irythn to question his role. He left his post in search of a path that aligns with his evolving sense of morality, seeking a balance between protecting the innocent and challenging oppressive systems.\r\n\r\nIrythn's internal conflict is central to his characterbalancing the duty to uphold order with the necessity to challenge unjust systems. This duality makes him a nuanced figure, capable of enforcing laws while questioning their morality. His combat prowess and strategic mind are used with precision, reflecting his depth and complexity as he seeks his true place in the royal order.	Supporting	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-23 10:22:00.333	2026-01-26 13:42:28.081	\N	5da036a0-d566-4d97-84fb-0dd04cf5aa33	\N	Male	#000000	http://localhost:3000/uploads/characters/39ea76be-86a3-4d0c-8814-d769a60dc0fc.png	{http://localhost:3000/uploads/characters/19c14047-70e2-4ff9-87bc-3f0bf64c73a6.png,http://localhost:3000/uploads/characters/00572a68-1c22-4fc0-a082-e5faab6cefc1.png}	\N	f	\N
