6d54a8b2-d379-483e-946d-9fe0525dca86	Kaos	I carved paradise out of godflesh. Look at it. Look at what weve become. - Kaylos, Kaos (Draecreth)\r\n\r\nBorn in an age when humanity cowered beneath the shadow of the Erylthyrageless demigods who shaped the world as playthingsKaos was a prodigy of violence and vision. A warrior and philosopher, he rejected the notion that humans were destined to be frail, ephemeral creatures. His ambition was singular: to make humanity the apex race, free from the whims of gods and their half-divine offspring. He saw the Erylthyr not as benevolent guides, but as chains binding mortal potential. Alongside his brother-in-arms, Mikael, Kaos became the first human to ascend to near-godhood through sheer will, transcending mortality without forsaking his forma feat deemed impossible.\r\n\r\nKaoss obsession led him to the western edge of the known world, where he and Mikael encountered The Whistlera being masquerading as human, yet radiating wrongness. Its melody tore reality, plunging them into a void where time and causality unraveled. There, the Whistler showed Kaos a vision: humanitys extinction, repeated across infinite timelines, always crushed by the Erylthyr or their Aelthar. But it also revealed a loopholea way to steal divinity. When the Whistler returned them to their world, it vanished, leaving Kaos with a burning truth: to elevate humanity, he would need to become the monster he despised.\r\n\r\nBy slaughtering the Erylthyr, Kaos severed the Aelthar influence on the world, achieving what he had sought all along.	Antagonist	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-15 18:22:42.274	2026-02-26 21:37:19.265	\N	7ff6b318-c6ec-455b-8a39-16999583c8a7	\N	Male	\N	http://localhost:3000/uploads/characters/58743282-ff69-4e6e-ade1-fa605ff25379.png	{http://localhost:3000/uploads/characters/ccdca97d-3f8e-4a89-87dc-67dba7e39ff6.png,http://localhost:3000/uploads/characters/a7963020-4f1c-42c9-8eea-951fcb857731.jpg,http://localhost:3000/uploads/characters/b9f100d1-e09e-41c4-af87-79cd6a6b6886.jpg,http://localhost:3000/uploads/characters/17acfd53-642d-4be0-93a9-560c4f13cd91.png,http://localhost:3000/uploads/characters/be25427d-774e-4048-8502-262fe02f1a17.png,http://localhost:3000/uploads/characters/8d4f8c0a-a711-4c3c-be4c-d8842150ad47.jpg}	\N	f	\N
ce68e072-5728-4fe8-8daa-03c4975d0924	Sir Dennys, the menace	Ah, the enigmatic nature of Sir Dennys, the menace. While his name may evoke notions of dishonor and chaos, it serves as a deliberate contrast to his true character and motivations. The choice of such a name is a part of his cunning strategy to deceive his enemies and maintain an aura of unpredictability.\r\n\r\nHe thrives in the shadows, navigating the treacherous waters of the world with a combination of wit, audacity, and a touch of trickery. He instills uncertainty and doubt in the minds of his adversaries.\r\n\r\nHowever, beneath his roguish exterior lies a complex individual driven by a deeper purpose. At times, he may resort to unconventional tactics and bend the rules\r\n\r\n\r\n\r\n\r\n\r\nJoseph Joestar x Captain Jack Sparrow. \r\n\r\nAlways somehow manages to come out on top through measures extraordinaire and unexplainable.	Supporting	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-15 18:22:42.275	2026-02-07 10:00:21.73	\N	7ff6b318-c6ec-455b-8a39-16999583c8a7	\N	Male	\N	http://localhost:3000/uploads/characters/392bbe8e-d32c-4187-af26-d074ceca7afe.png	{http://localhost:3000/uploads/characters/03db16e8-c855-4a6e-bc39-ac676f9c6b0a.png,http://localhost:3000/uploads/characters/edc5b07b-27d8-4d1c-b6e9-e92292b34825.png}	\N	f	\N
