7b6177fc-5d12-400f-9503-b7de34459854	Anathema	A condition that takes away one's lucidity slowly. Powerful men are corrupted and lose their lucidity, and become insane. The weak are rendered asleep with their eyes open. An endless sleep.  \r\n\r\nThe origins of the curse are unknown. It affects most people with weakness. But you see the truly powerful men are not killed, but corrupted. Some powerful men have been corrupted by the curse and have gone berserk. Shells of their true selves, they wait to devour. \r\n\r\n"Anathema will take everyone one day, none shall be saved. All corrupted. Anathema upon thee."	AFFLICTIONS	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-06-02 15:37:10.684	2025-06-02 15:37:10.684	{"duration": "", "severity": "", "symptoms": [], "treatment": "", "contagious": false}	\N	{}	http://localhost:3000/uploads/constructs/cb0daa5d-0e52-456d-ace5-77b38dc3ff01.png	{http://localhost:3000/uploads/constructs/1cf1b0ff-f191-45e0-b572-393dfa93bf62.png}
e475f171-8340-4874-bbb2-91b1a67cdaa9	Chrysalis	It consumes and transforms, so the net death is in fact zero, since when the host dies, the parasitic chrysalis emerges. The influence of an Aelthar that grows and consumes that which is plentiful to feast upon and grow on top of. \r\n\r\n\r\nA potential story is when people try to drive away Chrysalids and Chrysalis, they try to throw the people afflicted into lakes, which leads to a catalyst event that spreads it even more, of decay and stagnation. Could have a festival or ritual about this as well.\r\n\r\n\r\n"A seed in a barren soil might curl up into a coil\r\nFlourish into something to\r\nGive back what you thought was "you"\r\nAnd give way to all that is new"\r\n\r\n"decay is not death, but a prelude to emergence."	MANIFESTATIONS	7f251920-f7b9-4861-b738-a1e8a4f53463	2025-06-02 21:35:13.949	2025-06-02 21:35:13.949	{"range": "", "effects": "", "triggers": [], "frequency": "", "visibility": "Visible"}	\N	{}	http://localhost:3000/uploads/constructs/a60fb621-bf50-4166-b9a8-54b1866fa19b.webp	{http://localhost:3000/uploads/constructs/3de4d488-93e7-473d-baa8-c05f685ae587.jpg}
