COPY public.races (id, name, description, lifespan, languages, origins, universe_id, "createdAt", "deletedAt", "updatedAt", avatar_url, image_urls) FROM stdin;
7ff6b318-c6ec-455b-8a39-16999583c8a7	Human	Humans are the tenacious children of a world shaped by gods and their heirs, a race defined not by divine lineage but by relentless ambition and adaptability. Mortality is humanitys greatest burdenand its sharpest weapon. With lifespans rarely stretching beyond 70 to 90 years, humans live with a urgency that drives them to build, conquer, and dream. They are ephemeral sparks in the grand tapestry of time, yet their fleeting existence fuels innovation, passion, and a hunger for legacy that outshines even the ageless\t		{}		7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-08 14:24:06.523	\N	2025-02-08 14:24:06.523	http://localhost:3000/uploads/races/1f0015fb-8f52-4ea7-abf6-cb5f6a0b699e.png	{http://localhost:3000/uploads/races/826cf48b-9ff5-42ad-ac2a-f99319fea2ca.png,http://localhost:3000/uploads/races/ff708868-ace4-4296-8443-ab5f017a40c4.png,http://localhost:3000/uploads/races/97373a4c-b9de-47ba-87e2-437eb7369d9c.png,http://localhost:3000/uploads/races/2e3b6b7d-1571-4bf0-b3e7-3ef3e8e7317c.png,http://localhost:3000/uploads/races/c19c65fd-6785-410d-a809-0e7066e64b5a.png}
9214151f-addb-4e12-9a74-1ddacbbfcd40	Erylthyr (Godchildren)	The Erylthyr are the chosen scions of the Lords, born from the divine essence of Order and Chaos and imbued with fragments of their creators boundless power. Neither fully mortal nor truly divine, they are ageless beings who walk the worlds as living conduits of their Lords will. Each Erylthyr is a masterpiece of cosmic design, shaped to reflect the domain of their patronwhether it be the relentless flow of time, the infinite expanse of the void, or the delicate balance of life and death.\r\n\r\n\r\nThough they are not immortal, the Erylthyr endure for eons, their existence marked by a quiet, inevitable permanence. They are the architects of mortal destinies, the weavers of cosmic threads, and the silent guardians of the balance between Order and Chaos. Yet, for all their power, they are bound by the limitations of their creation: they cannot ascend to the full divinity of their Lords, nor can they escape the purpose for which they were made.\r\n\r\nTo mortals, the Erylthyr are both revered and fearedbeings of unimaginable beauty and terror, whose presence can herald either salvation or ruin. They are the hands of the Lords upon the worlds, shaping reality with a touch that is both gentle and inexorable. And though they may falter, though they may fall, the Erylthyr endure, for they are the eternal children of the cosmos, forever caught between the light of creation and the shadow of oblivion.		{}		7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-08 20:44:26.761	\N	2025-02-08 20:46:28.259	http://localhost:3000/uploads/races/0c0242ae-1629-4d95-bd39-9a7c15f5c8d9.png	{http://localhost:3000/uploads/races/288ccb02-bea4-41f9-ab13-83829bca7c72.png}
e4522f38-912e-4b3d-9283-db59f2c1e7ed	Aelthar (The Lordren)	The Lords are the essence of Order and Chaos made manifest, their existence a reflection of the eternal struggle and harmony that defines the cosmos.\t		{}		7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-15 20:12:31.061	\N	2025-02-15 20:12:31.061	http://localhost:3000/uploads/races/096ccfba-83e7-42fd-b48d-a88d68d5f617.png	{http://localhost:3000/uploads/races/4ccfaa40-6a0b-4f62-9a4d-1c40e86b38d1.png}
a0a05a6b-5e74-4996-a967-bd90268fafb5	Archaec	Archaecs are humanoid in appearance but are distinctly otherworldly. Their eyes are usually a piercing crimson or a void-like black giving them an unsettling gaze. Their hair is either a deep, raven black or a blood-red crimson, often wild and unkempt, adding to their chaotic appearance. Archaecs have extreme body typeseither unnaturally skinny, with elongated limbs and sharp features, or excessively muscular, with bulging veins and a towering, intimidating presence. Their physical strength is far beyond that of a normal human, allowing them to crush bones with ease and leap great distances.		{}		7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-12 22:01:13.813	\N	2025-03-23 11:05:16.585	http://localhost:3000/uploads/races/8d765f07-7789-4293-bdf9-d6d76de5d1d3.png	{http://localhost:3000/uploads/races/7c6a2e78-1fd8-4db9-b9d4-3246c70c92f4.png,http://localhost:3000/uploads/races/7849bc8a-8647-417c-8ff2-5ebae04b0de8.png,http://localhost:3000/uploads/races/aece336e-8a80-4acc-b215-33f94caebe24.png}
438116c7-03bc-485b-bbe6-312098db9aaa	Arboreal	Arboreals are a unique race dwelling within dense evergreen forests, known for their remarkable ability to manipulate and shape trees into intricate homes, dwellings, and even castles suspended high among the forest canopy. They live in harmony with nature, cultivating sustainable practices that blend seamlessly into their woodland surroundings. Skilled in crafting from natural materials, Arboreans are adept at using the forest's resources creatively for shelter, food production, energy, and artistry, reflecting a deep cultural connection to the earth and its cycles. Their communities thrive on the principles of balance and coexistence, fostering a society that is both resilient against the forest's challenges and deeply attuned to its rhythms and harmony. They are a largely matriarchal society. 	200	{Verdish}		7f251920-f7b9-4861-b738-a1e8a4f53463	2025-03-23 11:05:01.643	\N	2025-05-03 10:56:32.186	http://localhost:3000/uploads/races/545f4e5c-e876-468e-ae5f-ed94d2e3bd7a.png	{http://localhost:3000/uploads/races/5c04c9bd-0d3a-4e67-b166-2cafedfb8552.png,http://localhost:3000/uploads/races/c21e8e41-14c6-41af-b564-da458f413039.png,http://localhost:3000/uploads/races/d265a8a0-d125-4451-b068-f8c3b5814530.png,http://localhost:3000/uploads/races/6926c0de-6f58-47cd-af26-98045d0adfb4.png,http://localhost:3000/uploads/races/fbff5295-6cd5-42b2-b9d6-a9e62ea7201a.png}
5da036a0-d566-4d97-84fb-0dd04cf5aa33	Lumen	The Lumen are the enigmatic inheritors of the Erylthyrs legacy, a race of beings who walk the line between humanity and divinity. Towering over ordinary humans, though they would appear human at first glance, the Lumen are marked by subtle differences that set them apart. Their eyes, ordinary in moments of calm, ignite with a radiant silver-white glow in times of extreme stress, danger, or when they push themselves to their limits. This luminous flare is a glimpse of the divine spark that lingers within them, a faint echo of the Erylthyrs boundless power. Their hair grow faster than humans, much faster, most lowborn Lumen are henceforth of long hair.\r\n\r\nThe Lumen live far longer than humans, their lifespans stretching to twice that of a mortalsthough this longevity is inconsistent and unpredictable. Some Lumen may live for centuries, while others age more rapidly, their bodies succumbing to the strain of their inherited gifts. This inconsistency is a reminder that they are not truly divine, but rather beings caught between the mortal and the eternal. \r\n\r\nTheir connection to the Erylthyr is a mystery that has puzzled scholars and sages for generations. Some believe the Lumen are the descendants of the Erylthyr, their bloodline diluted but still carrying traces of their ancestors power. Others claim they are the result of the Erylthyrs final acta deliberate scattering of their essence into the mortal world, ensuring that their legacy would endure even as they faded into extinction. Whatever the truth, the Lumen are living relics of a bygone age, their existence a fragile bridge between the divine and the mortal		{}		7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-08 05:05:45.689	\N	2026-02-07 09:54:00.902	http://localhost:3000/uploads/races/e497c969-fc7f-42e1-a4ae-3185467e07fe.png	{http://localhost:3000/uploads/races/8c2d5424-6e9f-4d97-955c-bbadce43b724.png,http://localhost:3000/uploads/races/00a70bb4-8730-495c-845d-9b916d1ae71b.png,http://localhost:3000/uploads/races/ff1cd194-bf00-49eb-ba73-b02a70a47518.png,http://localhost:3000/uploads/races/a4d28431-f67d-4cbe-b156-ebe420b4c75a.png,http://localhost:3000/uploads/races/6e73f708-7c9f-4d09-b6ea-90116dbeaf0b.png}
d96cef44-a943-4edd-b61d-9eb4834c79c0	Epiraph	The Epiraphs are a humanoid race born of altitude, silence, and law. To an untrained eye they resemble fair-skinned humansslender, symmetrical, almost delicatebut this similarity is a deception. Their stillness hides speed that borders on the unnatural, and their composure masks a rigid, unforgiving worldview.\r\n\r\nThey are creatures of Order, not as a moral choice but as an instinct. Where chaos mutates and adapts, Epiraphs refine, align, and freeze reality into what they believe is its correct state. \r\n\r\nEpiraphs are lean and lightly built, favoring efficiency over brute strength. Their musculature is dense but restrained, lending them extraordinary quickness rather than power. Movement among them is economicalno wasted steps, no erratic gestures. Even in battle, an Epiraph appears calm, almost detached.\r\n\r\nHair: Universally white or silvered, regardless of age\r\n\r\nEyes: Pale tonesice-blue, frost-grey, or voided white\r\n\r\nTemperature: Their skin is unnaturally cold to the touch\r\n\r\nAging: Slow and subtle; age is measured more by demeanor than appearance\r\n\r\nThey do not sweat, rarely shiver, and are unaffected by extreme cold. Snow gathers on them without melting.		{}		7f251920-f7b9-4861-b738-a1e8a4f53463	2026-02-07 11:10:04.245	\N	2026-02-07 11:21:34.877	http://localhost:3000/uploads/races/c5f05184-6336-4ce1-b978-36dc43d495c8.png	{http://localhost:3000/uploads/races/09af6b48-5cb9-4f8a-b98c-c22c9646419c.png,http://localhost:3000/uploads/races/8bc50ae1-ff62-4294-8057-2db90651d815.png}
e2f41ff4-c340-45bc-b269-d4827365eec6	Mosaic	A Mosaic body is a living contradiction. Human bone structure and cognition anchor them, but animal traits are grafted into their biology in ways that are neither decorative nor symbolic  they are functional, instinctive, and often dominant.\r\n\r\nHorns grow along human skull patterns but spiral or branch according to the animal influence. Eyes adapt to nocturnal, predatory, or herd awareness. Limbs may carry digitigrade balance, talons, hooves, or scaled plating, depending on their lineage.\r\n\r\nNo two Mosaics are identical. Each is a unique fusion  a living collage of traits that may harmonize or constantly compete.		{}		7f251920-f7b9-4861-b738-a1e8a4f53463	2025-02-15 22:24:20.764	\N	2026-02-17 21:36:59.937	http://localhost:3000/uploads/races/09e9d1e5-9308-49c6-9298-4e56237deb0f.png	{http://localhost:3000/uploads/races/536f5800-9e67-409e-900a-30610ea34f69.png,http://localhost:3000/uploads/races/08df194b-0074-4ec0-bb35-83020c11d11c.jpg,http://localhost:3000/uploads/races/4bc920e5-7b74-4c17-bcfc-820257819765.jpg,http://localhost:3000/uploads/races/f3de549a-1495-4093-89d8-919ad7e8fb51.png,http://localhost:3000/uploads/races/4d0f8149-114f-4999-994f-5c8ad342b407.png,http://localhost:3000/uploads/races/a424eab5-b5e1-4a56-a639-52858d854c4a.png,http://localhost:3000/uploads/races/0ad1c546-5c56-4124-8078-9de6967f0725.png}
\.


