f27fa1d2-809d-4d9b-b2ed-573863cadd8f	Feria	Feria is a harsh northern kingdom forged by cold, height, and endurance. Snow grips its lands for most of the year, glaciers carve its valleys, and relentless winds sweep across jagged mountain ranges that form natural walls around the realm. Survival here demands resilience, and that resilience defines the Ferian people.\r\n\r\nUnlike scattered warrior tribes, Feria stands united under a single king. Beneath him rule powerful regional lords who govern mountain territories and frozen coasts, each sworn in absolute loyalty to the crown. Authority is firm, structured, and unquestioned.\r\n\r\nAt the heart of the kingdom rises Varamor, a great mountain city carved into steep stone heights. Above it all stands Castle Blackhaven, a colossal fortress of black stone crowning the summit and stretching along the surrounding ridgelines like an iron crown. The city descends below in fortified tiers, its walls, towers, and narrow climbing streets built to endure siege, storm, and time itself. Varamor is not just a capital, it is a fortress layered upon a fortress.\r\n\r\nFerias power does not end in its mountains. Its longships dominate the frozen seas and treacherous coasts, built to endure brutal waters and strike where others cannot travel. Swift coastal raids and sudden landings make Ferian forces unpredictable and feared far beyond their borders.\r\n\r\nYet the kingdoms greatest defense is not its army, but its land. Towering mountain barriers choke invasion routes into narrow passes. Blizzards swallow supply lines. Bitter cold weakens armies long before battle is joined. Even if invaders survive the climb, they face a capital built high above them, protected by sheer altitude and impenetrable stone. Many believe that conquering Feria is less a war against men than a war against winter itself, and winter always wins.\r\n\r\nTo the southern kingdoms, the people of Feria are often dismissed as uncultured brutes, creatures of snow, violence, and stubborn pride. But those who understand warfare know the truth:\r\n\r\nFeria is not savage.\r\nFeria is immovable.\r\nAnd no empire has ever taken what the mountains refuse to surrender.	7f251920-f7b9-4861-b738-a1e8a4f53463	f6892756-90a0-4c83-be86-00027028a8cc	2025-02-23 18:02:27.798	2026-02-14 19:13:08.939	STATE	{}	7507fdd5-d01c-49b6-8574-f3d08338f7a3	\N	null	\N	\N	null	\N	\N	\N	{}	\N	\N	\N	\N	\N	{}	http://localhost:3000/uploads/regions/7e353336-ccb9-4ff7-95df-bf569e0cab5c.png	{http://localhost:3000/uploads/regions/6d7f9c45-a80d-490d-ac8b-459c561cec4c.png}	\N
d7ba07c0-5c54-4ae3-9d5e-51cd56731ef7	Braithlait	Braithlait stands as the continents most politically complex and ceremonially grand realm: a land of layered loyalties, noble houses, and ancient crowns. Its rolling green highlands and fog-draped coastlines are dotted with fortified keeps that have stood for centuries, each bearing banners of proud lineages older than written record.\r\n\r\nPower is shared uneasily between monarch and nobility. Dukes command vast territories, knightly orders maintain martial honor, and councils of lords constantly maneuver for influence. Oaths are sacred, but ambition is rarely quiet.\r\n\r\nBraithlaits military strength lies in discipline and hierarchy. Heavily armored cavalry, longbow regiments, and castle warfare define its strategy. Wars here are often slow, grinding campaigns of siege and supply rather than sudden conquest.\r\n\r\nReligion is deeply interwoven with governance. Grand cathedrals dominate major cities, and divine authority is frequently invoked to legitimize rulership. Festivals, coronations, and tournaments are spectacles of unity, and displays of power.	7f251920-f7b9-4861-b738-a1e8a4f53463	f6892756-90a0-4c83-be86-00027028a8cc	2025-02-23 18:25:58.083	2026-02-14 19:29:39.453	STATE	{}	7507fdd5-d01c-49b6-8574-f3d08338f7a3	\N	null	\N	\N	null	\N	\N	\N	{}	\N	\N	\N	\N	\N	{}	http://localhost:3000/uploads/regions/891bff85-3d62-4448-8b28-3f8bec2ebd42.png	{http://localhost:3000/uploads/regions/f2ec0418-3a6c-4509-82f5-afedb8c2684e.png,http://localhost:3000/uploads/regions/6bd86c8e-5f8e-4f9d-8530-53700b370a46.png,http://localhost:3000/uploads/regions/e4234530-a18d-4ea3-b8c4-75acd691f08b.png}	\N
dd15b0c3-88f0-4f10-b71f-5701b665a444	Aeran	In Aeran, the land rises in long, unbroken walls of stone. Mountains fold over one another in endless succession, their peaks catching snow that lingers even when lower valleys thaw. Roads do not cross the realm  they wind, climb, and vanish into mist before reappearing days later along another ridge. Distance is measured less by miles than by elevation, weather, and patience.\r\n\r\nSettlements grow where the mountains permit them. Cities are carved into terraces, their walls anchored deep into rock. Villages cling to narrow valleys warmed briefly by passing sunlight. High passes open only part of the year, and when winter closes them, entire regions turn inward, self-contained and silent beneath drifting snow.\r\n\r\nAbove all of it  above valleys, provinces, and ridgelines  stands the Imperial Throne.\r\n\r\nThe Emperor is seen rarely and commands even less, yet every banner, law, and oath traces its authority upward to that single seat. The throne does not direct the realms daily life; it gives the realm its shape. Its presence binds distant regions that might otherwise never look beyond their own mountains.	7f251920-f7b9-4861-b738-a1e8a4f53463	f6892756-90a0-4c83-be86-00027028a8cc	2025-02-23 18:27:29.231	2026-02-14 20:07:36.152	STATE	{}	7507fdd5-d01c-49b6-8574-f3d08338f7a3	\N	null	\N	\N	null	\N	\N	\N	{}	\N	\N	\N	\N	\N	{}	http://localhost:3000/uploads/regions/a01aa029-c705-4a63-9f26-ac12eca9ab9e.jpg	{http://localhost:3000/uploads/regions/68e73bc0-af99-462b-a056-9bdfb2e5054e.jpg,http://localhost:3000/uploads/regions/9cf567af-9170-496f-bc3c-2bfa2dda132b.jpg,http://localhost:3000/uploads/regions/63a154ee-cfc1-4c4b-b146-a42b2e3ca81e.jpg,http://localhost:3000/uploads/regions/3dd9b60d-8e21-454f-b66f-8aa1b0121e43.jpg}	\N
3075a018-5a35-43f9-8564-1fa86e638cbf	Estan	In Estan, the air hums with life long before sunrise. Temple bells echo across riverbanks as mist lifts from stepped ghats, merchants unfurl bright fabrics along crowded streets, and the scent of spice and incense drifts through layered cities built and rebuilt across centuries.\r\n\r\nEvery region moves to its own rhythm. Some lands are shaped by great rivers that flood and recede like breathing lungs. Others rise in terraced hills thick with cultivation, or stretch across deep forests where ancient shrines stand half-claimed by roots and time. Roads between provinces carry caravans laden not only with goods, but with dialects, rituals, music, and memory.\r\n\r\nPower flows from a single royal throne, distant yet ever-present. The kings authority travels through governors, magistrates, temple councils, and noble houses, each overseeing lands as different from one another as seasons. Laws bind the empire together, but tradition gives it texture. In one city, festivals fill the night with flame and drum. In another, scholars debate philosophy beneath carved stone colonnades worn smooth by generations. Estan builds upward and outward at once, palaces ringed with gardens and water courts, markets layered in spirals of stone, temples rising like mountains shaped by human devotion. Color is everywhere: painted walls, woven banners, ceremonial dress, flowering courtyards. Even the simplest street can feel like part of something ancient and deliberate.	7f251920-f7b9-4861-b738-a1e8a4f53463	f6892756-90a0-4c83-be86-00027028a8cc	2025-02-23 18:29:03.706	2026-02-14 19:26:07.844	STATE	{}	7507fdd5-d01c-49b6-8574-f3d08338f7a3	\N	null	\N	\N	null	\N	\N	\N	{}	\N	\N	\N	\N	\N	{}	http://localhost:3000/uploads/regions/f1543aac-26c0-4924-abcc-3add3fbe3d01.jpg	{http://localhost:3000/uploads/regions/b7474c42-70f7-4c61-8216-58789d41086a.png,http://localhost:3000/uploads/regions/a0d6b724-3100-4fcc-a92a-551aced04817.png,http://localhost:3000/uploads/regions/fc46a7d6-420c-404a-b461-4664ae9fcecd.png,http://localhost:3000/uploads/regions/1961c29f-c82f-4906-8029-10d507ef374d.jpg}	\N
340d06e2-a7a0-4113-b2b5-88372d372a1a	Inys	Inys is not merely the northernmost landmass known to man  it is the place where the world forgets itself.\r\n\r\nThe island rises from a churning steel-grey ocean like a wound in the horizon. Its coasts are jagged and unwelcoming, carved by ancient ice and relentless wind. The ground is stone locked beneath layers of permafrost older than memory. Nothing grows in the soil except lichen the colour of ash, clinging like the last stubborn thought of life.\r\n\r\nThe wind never truly stops. It prowls, howls, whispers, then screams  as though the air itself resents being trapped here.\r\n\r\nMen say the land feels unfinished, as if creation abandoned the work halfway through and never returned.	7f251920-f7b9-4861-b738-a1e8a4f53463	f6892756-90a0-4c83-be86-00027028a8cc	2026-02-15 09:05:56.28	2026-02-15 09:05:56.28	ISLAND	\N	7507fdd5-d01c-49b6-8574-f3d08338f7a3	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	\N	http://localhost:3000/uploads/regions/b060e0e3-2d79-4f60-a1de-2cf40c21d46f.jpg	{http://localhost:3000/uploads/regions/17913106-2175-45c8-aec6-e8141142afb4.jpg}	\N
5b1bb9cf-e8a2-4a87-8255-38aff878c921	Ilyn mr	\N	7f251920-f7b9-4861-b738-a1e8a4f53463	f6892756-90a0-4c83-be86-00027028a8cc	2026-02-15 11:58:01.121	2026-02-15 12:45:45.042	ISLAND	{}	7507fdd5-d01c-49b6-8574-f3d08338f7a3	\N	\N	\N	\N	\N	\N	\N	\N	{}	\N	\N	\N	\N	\N	{}	http://localhost:3000/uploads/regions/275c2d23-4ffa-47da-927c-ec3346ad5ec8.webp	{http://localhost:3000/uploads/regions/7a0355d7-91d1-4439-8c9f-c1d9f3313027.webp,http://localhost:3000/uploads/regions/0d948777-209b-42be-bb62-651b9aeb51e5.webp}	\N
