17ab36df-c9ae-436c-8ee2-e858c3bebb1d	The Faith of the Arbor (The Faith of Eythedral)	The Faith of the Arbor, also called the Faith of Eythedral, is the spiritual tradition of the Arboreals, a forest-dwelling, largely matriarchal people who live in harmony with living trees. At its heart is the belief that the entire forest of Noor shares a single living consciousness, centered in Erythdral, the Great Tree. Rather than worshipping a distant deity, the Arboreals revere the forest itself as a unified mind in which all life, memory, and growth are interconnected. Their religion teaches balance, gentle guidance of nature rather than control, and the return of all beings to the living cycle of the forest after death.	{Eythedral}	{}	{}	{}	7f251920-f7b9-4861-b738-a1e8a4f53463	2026-02-23 17:01:27.092	2026-02-26 10:45:03.704	http://localhost:3000/uploads/religions/f3a1a4ad-dc1c-4be3-b0ea-71ce8545703f.png	{}
